  CREATE OR REPLACE EDITIONABLE TRIGGER "USER_2024_OTI_FINAL_TEAM4"."DOCUMENT_MANAGEMENT_SEQ_TRIGGER" 
BEFORE INSERT ON document_management_seq
FOR EACH ROW
DECLARE
