--  DDL for Trigger APPROVAL_LINE_SEQ_TRIGGER
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE TRIGGER "USER_2024_OTI_FINAL_TEAM4"."APPROVAL_LINE_SEQ_TRIGGER" 
BEFORE INSERT ON approval_line
FOR EACH ROW
DECLARE
    existing_seq NUMBER;
    max_seq NUMBER;
BEGIN
    IF :NEW.apr_line_index IS NULL THEN
        BEGIN
        SELECT apr_line_index 
        INTO existing_seq
        FROM approval_line
        WHERE EMP_ID = :NEW.EMP_ID
          AND APR_LINE_NAME = :NEW.APR_LINE_NAME
          AND ROWNUM = 1;
    
        :NEW.apr_line_index := existing_seq;
    
        EXCEPTION
            WHEN NO_DATA_FOUND THEN
                SELECT NVL(MAX(apr_line_index), 0) + 1 
                INTO max_seq
                FROM approval_line
                WHERE EMP_ID = :NEW.EMP_ID;
        
                :NEW.apr_line_index := max_seq;
        END;
    END IF;
END;
/
ALTER TRIGGER "USER_2024_OTI_FINAL_TEAM4"."APPROVAL_LINE_SEQ_TRIGGER" ENABLE;
